description:
Category	All Girl, Girl-Girl, Lesbian, Strap-On, Female Producers/Directors

Director	Dana Vespoli
Starring	Dakota Skye, Carter Cruise, Dana DeArmond, Keisha Grey, Shyla Jennings, Vicki Chase, Ashlyn Molloy, Sovereign Syre, Veruca James

The 8th volume of Sweetheart's popular strap-on series brings more mind blowing orgasms as well as an extra special treat: a strap-on three-way! Uptight dorm resident assistant Dana DeArmond overhears bratty students Shyla Jennings and Keisha Grey badmouthing her, so she gives them a piece of her mind...and a piece of something else! Conservative student Ashlyn Molloy has conflicting opinions with progressive professor Sovereign Syre, but the professor has a way of expanding the student's horizons...Vicki Chase tries to talk her way out of a sticky situation with Veruca James, but Veruca finds a way to quiet the Latin beauty... finally, bored teens Dakota Skye and Carter Cruise go searching for a way to pass a boring afternoon and discover more than they bargained for!
